(1, 'O Pequeno Príncipe', 'Antoine de Saint-Exupéry', 'ViaLeitura', 2, 'Le Petit Prince é uma novela do escritor, aviador aristocrata francês Antoine de Saint-Exupéry, originalmente publicada em inglês e francês em abril de 1943 nos Estados Unidos. Durante a Segunda Guerra Mundial, Saint-Exupéry foi exilado para a América do Norte.', );
INSERT INTO `livros` (`liv_codi`, `liv_titu`, `liv_auto`, `liv_edit`, `cat_codi`, `liv_sino`, `liv_imag`) VALUES
(2, 'Dom Quixote de la Mancha', 'Miguel de Cervantes', 'D.QUIXOTE', 3, 'Dom Quixote de la Mancha é um livro escrito pelo espanhol Miguel de Cervantes. O título e ortografia originais eram El ingenioso hidalgo Don Quixote de La Mancha, com sua primeira edição publicada em Madrid no ano de 1605.', ''),
(4, 'Guerra e Paz', 'Liev Tolstói', 'Paulus', 1, 'Guerra e Paz é um romance histórico escrito pelo autor russo Liev Tolstói e publicado entre 1865 e 1869 no Russkii Vestnik, um periódico da época. É uma das obras mais volumosas da história da literatura universal. O livro narra a história da Rússia à época de Napoleão Bonaparte.', NULL),
(5, 'O Patinho Feio', 'Hans Christian Andersen', 'Zahar', 2, 'O Patinho Feio é um conto de fadas do escritor dinamarquês Hans Christian Andersen, publicado pela primeira vez em 11 de Novembro de 1843 em Nye Eventyr. Første Bind. Første Samling. 1844.', NULL),
(6, 'O homem de giz', 'C.J. Tudor', 'editorateste', 11, 'Assassinato e sinais misteriosos em uma trama para fãs de Stranger Things e Stephen King   Em 1986, Eddie e os amigos passam a maior parte dos dias andando de bicicleta pela pacata vizinhança em busca de aventuras.', NULL);

